import React, { useState } from 'react';

function BugList() {
  const [bugs, setBugs] = useState([
    { id: 1, title: 'Login page crash', status: 'Open' },
    { id: 2, title: 'Dashboard UI glitch', status: 'In Progress' },
    { id: 3, title: 'Payment gateway issue', status: 'Closed' },
  ]);

  return (
    <div className="bug-list">
      <h2>Bug List</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Title</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {bugs.map((bug) => (
            <tr key={bug.id}>
              <td>{bug.id}</td>
              <td>{bug.title}</td>
              <td>{bug.status}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default BugList;
